import React from "react";

export const Meme = ({ template, onClick }) => {
  return (
    <img
      style={{
        borderWidth: 3,
        borderRadius: 20,
        maxWidth: 200,
        maxHeight: 200,
        borderColor: "red",
        overflow: "hidden",
        borderWidth: 3,
      }}
      key={template.id}
      src={template.url}
      alt={template.name}
      onClick={onClick}
    />
  );
};
